import React, { useState } from "react";
import './index.css'
const  App=()=>{
    const[activity,setActivity]=useState('');
return(
    <>
        <div className="container">
            <div>ToDo List</div>
            <input type="text" placeholder="Add Activity" value={activity} onChange={(e)=>setActivity(e.target.value)}/>
            <button>+</button>
        </div>
    </>
)
}
export default App;
